import React from 'react';
const Weather = ({ weather }) => {
    if(!weather) {
        return <div>Enter Valid Zip Code</div>
    }
    console.log(weather);
    for(let x in weather.main){
        if(x==='temp'){
            var temp = weather.main[x] + ' ºF'
        }
    }
    return( 
        <div className="item">
            <div className="content">
                <div className="header">
                    <label>Current Tempureature: </label>{weather.name}
                    <div>{temp}</div> 
                </div>
            </div>
        </div>
    );
}

export default Weather;
